/* eslint-disable import/prefer-default-export */
import { configureStore } from '@reduxjs/toolkit';
import vehiclesReducer from './slices/vehiclesSlice';

export const store = configureStore({
  reducer: {
    vehicles: vehiclesReducer,
  },
});
